import { Link } from "react-router-dom";
const axios = require("axios").default;
const MySite = (props) => {
  return (
    <div>
      <h2>posts Collection</h2>
      props.show.length ? (
            <h3>There is no post yet</h3>
          ) : (
      {props.show.map((post, index) => (
        <h2 key={index}>{post.title}</h2>
